import Vue from 'vue'
import VueRouter from 'vue-router'

Vue.use(VueRouter)

const routes = [
	{
		path: '/',
		name: 'layout',
		component: () => import('../views/layout/index.vue'),
		children: [
			{
			    path: "/home",
			    name: 'home',
			    component: () => import('@/views/home/index.vue'),
			    meta:{
			        title:"扶뒬못"
			    }
			},
		]
	}, 
]

const router = new VueRouter({
	mode: 'history',
	base: process.env.BASE_URL,
	routes
})

export default router
